import React from "react";
import ReactAnimatedWeather from "react-animated-weather";
import "./WeekWeatherStyle.css";

export default function Icon(props) {
  const codeMapping = {
    "01d": "CLEAR_DAY",
    "01n": "CLEAR_NIGHT",
    "02d": "PARTLY_CLOUDY_DAY",
    "02n": "PARTLY_CLOUDY_NIGHT",
    "03d": "CLOUDY",
    "03n": "CLOUDY",
    "04d": "CLOUDY",
    "04n": "CLOUDY",
    "05d": "PARTLY_CLOUDY_DAY",
    "05n": "PARTLY_CLOUDY_NIGHT",
    "06d": "CLOUDY",
    "06n": "CLOUDY",
    "07d": "CLEAR_DAY",
    "07n": "CLEAR_NIGHT",
    "08d": "PARTLY_CLOUDY_DAY",
    "08n": "PARTLY_CLOUDY_NIGHT",
    "09d": "CLOUDY",
    "09n": "CLOUDY",
    "04d": "CLOUDY",
    "04n": "CLOUDY",
    "05d": "PARTLY_CLOUDY_DAY",
    "05n": "PARTLY_CLOUDY_NIGHT",
    "06d": "CLOUDY",
    "06n": "CLOUDY",
  };


CLEAR_DAY;
CLEAR_NIGHT;
PARTLY_CLOUDY_DAY;
PARTLY_CLOUDY_NIGHT;
CLOUDY;
RAIN;
SLEET;
SNOW;
WIND;
FOG;


  return (
    <ReactAnimatedWeather
      icon={codeMapping[props.code]}
      color="black"
      size={25}
      animate={false}
    />
  );
}
